import React from 'react'
import { Link } from 'react-router-dom'

function Breadcrumb() {
  return (
    <div>
      <Link to={'/'}>Hotels/</Link>
      <Link to={'/info'}>Application</Link>
    </div>
  )
}

export default Breadcrumb
